    //precision lowp float;

    varying lowp vec4 vColor;

    void main(void) {
        gl_FragColor = vColor;

        //gl_FragColor = vec4(1.0, 1.0, 1.0, 1.0);
        //gl_FragColor = vec4(0.0, 0.0, 0.0, 1.0);
    }
</script>

<script id="shader-vs" type="x-shader/x-vertex">
    //precision highp float;
    //precision lowp float;

    attribute vec3 aVertexPosition;
    attribute vec4 aVertexColor;

    uniform mat4 uMVMatrix;
    uniform mat4 uPMatrix;
    
    varying lowp vec4 vColor;

    uniform float uTimeVar;

    float rand(vec2 co){
        return fract(sin(dot(co.xy ,vec2(12.9898,78.233))) * 43758.5453);
    }

    void main(void) {

        float x = aVertexPosition.x;
        //float x = aVertexPosition.x + cos((aVertexPosition.y + aVertexPosition.z + uTimeVar) * 25.0 ) * 1.0;

        float y = aVertexPosition.y;
        //float y = aVertexPosition.y + cos((aVertexPosition.x + aVertexPosition.z + uTimeVar) * 25.0 ) * 1.0;
        
        //float z = aVertexPosition.z + cos((aVertexPosition.x + aVertexPosition.y + uTimeVar) * 25.0 ) * 10.0;
        float z = aVertexPosition.z;

        gl_PointSize = 3.0;
        gl_Position = uPMatrix * uMVMatrix * vec4(x, y, z, 1.0);
        
        vColor = vec4(sin(aVertexColor.x * 2.0 + uTimeVar), cos(aVertexColor.y), sin(aVertexColor.z), 1.0);
    }
</script>

    var gl;
    var degMap = new Array(361);
    var const_pi_rad = Math.PI / 180.0;

    function initGL(canvas) {
        try {
            gl = canvas.getContext("experimental-webgl");
            gl.viewportWidth = canvas.width;
            gl.viewportHeight = canvas.height;

            for(i=0;i<361;i++) {
                degMap[i] = i * const_pi_rad;
            }
        } catch (e) {
        }
        if (!gl) {
            alert("Could not initialise WebGL, sorry :-(");
        }
    }


    function getShader(gl, id) {
        var shaderScript = document.getElementById(id);
        if (!shaderScript) {
            return null;
        }

        var str = "";
        var k = shaderScript.firstChild;
        while (k) {
            if (k.nodeType == 3) {
                str += k.textContent;
            }
            k = k.nextSibling;
        }

        var shader;
        if (shaderScript.type == "x-shader/x-fragment") {
            shader = gl.createShader(gl.FRAGMENT_SHADER);
        } else if (shaderScript.type == "x-shader/x-vertex") {
            shader = gl.createShader(gl.VERTEX_SHADER);
        } else {
            return null;
        }

        gl.shaderSource(shader, str);
        gl.compileShader(shader);

        if (!gl.getShaderParameter(shader, gl.COMPILE_STATUS)) {
            alert(gl.getShaderInfoLog(shader));
            return null;
        }

        return shader;
    }


    var shaderProgram;

    function initShaders() {
        var fragmentShader = getShader(gl, "shader-fs");
        var vertexShader = getShader(gl, "shader-vs");

        shaderProgram = gl.createProgram();
        gl.attachShader(shaderProgram, vertexShader);
        gl.attachShader(shaderProgram, fragmentShader);
        gl.linkProgram(shaderProgram);

        if (!gl.getProgramParameter(shaderProgram, gl.LINK_STATUS)) {
            alert("Could not initialise shaders");
        }

        gl.useProgram(shaderProgram);

        shaderProgram.vertexPositionAttribute = gl.getAttribLocation(shaderProgram, "aVertexPosition");
        gl.enableVertexAttribArray(shaderProgram.vertexPositionAttribute);

        shaderProgram.vertexColorAttribute = gl.getAttribLocation(shaderProgram, "aVertexColor");
        gl.enableVertexAttribArray(shaderProgram.vertexColorAttribute);

        shaderProgram.pMatrixUniform = gl.getUniformLocation(shaderProgram, "uPMatrix");
        shaderProgram.mvMatrixUniform = gl.getUniformLocation(shaderProgram, "uMVMatrix");

        shaderProgram.timeVar = gl.getUniformLocation(shaderProgram, "uTimeVar");
    }


    var timeVar = 0.0;
    var mvMatrix = mat4.create();
    var mvMatrixStack = [];
    var pMatrix = mat4.create();

    function mvPushMatrix() {
        var copy = mat4.create();
        mat4.set(mvMatrix, copy);
        mvMatrixStack.push(copy);
    }

    function mvPopMatrix() {
        if (mvMatrixStack.length == 0) {
            throw "Invalid popMatrix!";
        }
        mvMatrix = mvMatrixStack.pop();
    }


    function setMatrixUniforms() {
        gl.uniformMatrix4fv(shaderProgram.pMatrixUniform, false, pMatrix);
        gl.uniformMatrix4fv(shaderProgram.mvMatrixUniform, false, mvMatrix);
        gl.uniform1f(shaderProgram.timeVar, timeVar);
    }


    function degToRad(degrees) {
        /*
        var deg = Math.round(degrees);
        if(deg > 360) deg -= 360;

        */
        return degrees * const_pi_rad;

    var rLogo = 0;

    function drawScene() {
        gl.viewport(0, 0, gl.viewportWidth, gl.viewportHeight);
        gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);

        mat4.perspective(45, gl.viewportWidth / gl.viewportHeight, 0.1, 400.0, pMatrix);

        mat4.identity(mvMatrix);
        mat4.translate(mvMatrix, [0.0, 0.0, -200.0]);

        mvPushMatrix();
        mat4.rotate(mvMatrix, degToRad(rLogo), [0.0, 0.1, 0.0]);

        gl.bindBuffer(gl.ARRAY_BUFFER, logoVertexPositionBuffer);
        gl.vertexAttribPointer(shaderProgram.vertexPositionAttribute, logoVertexPositionBuffer.itemSize, gl.FLOAT, false, 0, 0);

        gl.bindBuffer(gl.ARRAY_BUFFER, logoVertexColorBuffer);
        gl.vertexAttribPointer(shaderProgram.vertexColorAttribute, logoVertexColorBuffer.itemSize, gl.FLOAT, false, 0, 0);



        setMatrixUniforms();

        //gl.drawArrays(gl.TRIANGLES, 0, logoVertexPositionBuffer.numItems);
        gl.drawArrays(gl.POINTS, 0, logoVertexPositionBuffer.numItems);

        mvPopMatrix();
    }

    var lastTime = 0;

    function animate() {
        var timeNow = new Date().getTime();
        if (lastTime != 0) {
            var elapsed = timeNow - lastTime;

            rLogo += (60 * elapsed) / 1000.0;
        }
        lastTime = timeNow;

        timeVar += 0.002;
    }


    function tick() {
        requestAnimFrame(tick);
        drawScene();
        animate();
    }


    function webGLStart() {
        var canvas = document.getElementById("canvas");
        initGL(canvas);
        initShaders()
        initBuffers();

        gl.clearColor(0.0, 0.0, 0.0, 1.0);
        //gl.clearColor(1.0, 1.0, 1.0, 1.0);
        gl.enable(gl.DEPTH_TEST);

        tick();
    }
